import React from 'react'

const Yourorder = () => {



    const callOrderPage = async () => {
        try {
            const response = await fetch("/getuserorder", {
                method: "GET",
                headers: {
                    Accept: "application/json",
                    "Content-Type": "application/json"
                },
                credentials: "include"
            });

            const res = await response.json();
            console.log(res);
            setUserData(res);

            if (!response.ok) {
                const error = new Error(res.error);
                throw error;
            }
        } catch (err) {
            console.log(err);
        }
    }

    useEffect(() => {
        callOrderPage();
    }, []);


  return (
    <>
      <section className="section" id="my-orders">
        <div className="section-header">
          <p>My Orders</p>
        </div>
        <div className="container">
           <h4 style={{"text-align":"center"}}>Date: 28/10/2023</h4> 
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>Order Date</th>
                <th>Total Amount</th>
                <th>Order Status</th>
                <th>Payment Status</th>
              </tr>
            </thead>
            <tbody>
             <tr>
                <td>123</td>
                <td>1250</td>
                <td>pending</td>
                <td>complete</td>
            
             </tr>
            </tbody>
          </table>
        </div>
      </section>
    </>
  )
}

export default Yourorder
